import React, { Component } from 'react';

import Countdown from './Countdown';

const events = require("../countdown-list.json");

export default class CountdownContainer extends Component {

    render() {
        return (
            <div className="App">
                <h1>Stuff be happening!</h1>
                {events.map(event =>
                    <Countdown
                        key={event.id}
                        title={event.title}
                        month={event.month}
                        day={event.day}
                        year={event.year}
                        image={event.background}
                    />
                )}
            </div>
        )
    }
}
